import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import List from '../components/List';
import { DragDropContext } from 'react-beautiful-dnd';

const HomePage = () => {
    const [tasks, setTasks] = useState([]);
    const [lists, setLists] = useState([]);

    useEffect(() => {
        const fetchTasks = async () => {
            const token = localStorage.getItem('token'); 
            try {
                const response = await fetch('http://127.0.0.1:5000/lists', {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });
                if (!response.ok) {
                    window.location.href = '/login'; // Redirect to login page if not authorized
                    //throw new Error('Network response was not ok');
                }
                const data = await response.json();
                setTasks(data);
            } catch (error) {
                console.error("Error fetching tasks:", error);
            }
        };

        fetchTasks();
        // if token is not present, redirect to login page
        if (!localStorage.getItem('token')) {
            window.location.href = '/login';
        }

        const getLists = async () => {
            const token = localStorage.getItem('token');
            fetch('http://127.0.0.1:5000/get-lists', {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                })
                .then(response => response.json())
                .then(data => {
                    setLists(data);
                })
                .catch(error => console.error('Error:', error));

        };
        getLists();
            }, []);

    const onEdit = (id, title) => {
        const token = localStorage.getItem('token');
        fetch('http://127.0.0.1:5000/edit-task', {
            method: 'PUT',
            headers: {
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${token}`
            },
            body: JSON.stringify({ id, title }),
        })
        .then(response => response.json())
        .then(data => {
            console.log('Success:', data);
            // Update the local state to reflect the edited task
            const updatedTasks = tasks.map(task => {
                if (task.id === id) {
                    return { ...task, title };
                }
                return task;
            });
            setTasks(updatedTasks);
        })
        .catch(error => console.error('Error:', error));
    };

    const onDelete = (id) => {
        const token = localStorage.getItem('token');
        fetch(`http://127.0.0.1:5000/delete-task/${id}`, {
            method: 'DELETE',
            headers: {
                'Authorization': `Bearer ${token}`
            }
        })
        .then(response => response.json())
        .then(data => {
            console.log('Delete successful:', data);
            // Update local state to remove the deleted task
            const remainingTasks = tasks.filter(task => task.id !== id);
            setTasks(remainingTasks);
        })
        .catch(error => console.error('Error:', error));
    };

    const onDragEnd = (result) => {
        const { source, destination } = result;

        // Dropped outside the list
        if (!destination) {
            return;
        }

        // Implement logic to reorder tasks or move them between lists
        if (source.droppableId !== destination.droppableId) {
            const sourceListIndex = lists.findIndex(list => list.id === parseInt(source.droppableId));
            const destListIndex = lists.findIndex(list => list.id === parseInt(destination.droppableId));
            const sourceList = lists[sourceListIndex];
            const destList = lists[destListIndex];
            const [removed] = sourceList.tasks.splice(source.index, 1);
            destList.tasks.splice(destination.index, 0, removed);

            const newLists = [...lists];
            newLists[sourceListIndex] = sourceList;
            newLists[destListIndex] = destList;

            // Update state
            setLists(newLists);
        } else {
            // Move within the same list (optional)
        }
    };    

    const renderTasks = () => {
        // Group tasks by list_id
        const groupedTasks = tasks.reduce((acc, task) => {
            if (!acc[task.list_id]) acc[task.list_id] = [];
            acc[task.list_id].push(task);
            return acc;
        }, {});

        // Merge tasks with their respective lists
        const listsWithTasks = lists.map(list => ({
            ...list,
            tasks: groupedTasks[list.id] || [] // Ensures that lists without tasks get an empty array
        }));
        return listsWithTasks.map(list => (
            <div key={list.id}>
                <List key={list.id} list={list} onEdit={onEdit} onDelete={onDelete} />
                <Link to={`/new-task/${list.id}`}>Add New Task</Link>
            </div> 
        ));    
    };

    const Wrapper = () => {
        return (
            <div className="home-page">
            <h1>Lists</h1>
            <DragDropContext onDragEnd={onDragEnd}>
                {renderTasks()}
            </DragDropContext>
            <Link to={`/new-list`}>Add New List</Link>
        </div>
        );
    };

    return (
        <>
        <Wrapper />
        </>
    );
};

export default HomePage;
